import {React, useEffect} from 'react'
import UserContainer from './Components/UserContainer'
import { useDispatch } from 'react-redux'

const App = (props) =>{

  const dispatch = useDispatch()

  useEffect(()=>{
    dispatch(asyncGetAllUsers())
  }, [dispatch])

  return (
    <div>
      <h1>Users List Assignment</h1>
      <UserContainer/>
    </div>
  )
}

export default App
